import "../styles/addFav.css"
const AddFav = () => {
    let [title,setTitle]=useState("")
    let [genre,setGenre]=useState("")
    let [language,setLanguage]=useState("")
    let [rating,setRating]=useState("")
    return ( 
        <div className="addfav">
            <h1 style={{}}>ADD TO FAV</h1>
            <div className="form">
            <div className="form_img">
            <img height="500px" width="400px" src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRW-J66injoFCxZRk3WiDtJfklL2gAKUR0H4A&usqp=CAU" alt="" />
        </div>
        <div className="form_input">
            <form action="">
                <div className="title">
                    <input type="text" placeholder="Enter title" />
                </div>
                <div className="genre">
                    <input type="text" placeholder="Enter genre" />
                </div>
                <div className="language">
                    <input type="text" placeholder="Enter language" />
                </div>
                <div className="rating">
                    <input  type="text" placeholder="Enter rating" />
                </div>
                <button>Add to favourites</button>
            </form>
        </div>
        </div>
        </div>
     );
}
 
export default AddFav;
